/* styles */
import React, {useState} from 'react';
import styles from './index.scss';

const HeadlineModule = ({title, subtitle}, props) => {
  return (
    <div className={styles.wrapper}>
      <div className={styles.box} style={props.background}></div>
      <h1 className={styles.title} style={props.color}>
        {title}
      </h1>
      <h2 className={styles.subtitle} style={props.color}>
        {subtitle}
      </h2>
    </div>
  );
};

export default HeadlineModule;
